Kimberly, Lilli's best friend since grade school, had just broken up with her overtly flirtatious boyfriend. She consoled her as best she could and figured the best way to make her feel better was to play a little frisky game by blindfolding her, caressing, teasing and gently kissing her. Kim was astonished that her gal pal would even break those personal boundaries, but she always secretly had a bit of a crush on her. She went along with it, and they both gradually went a little further and further with every passing moment. While they were caught up in each others bodies, making out and groping, Lilli's step mom, Brandi, walked into the house and overheard some of the commotion going on upstairs. She walked in on them and was surprised to find them in the throes of passion. Brandi told her stepdaughter how shocked she was and eventually finagled her way into a threesome with them. It was Lilli's only way of insuring her step mom would keep their little secret.
